import React, { Component } from 'react';

import History from "./history";
import Events from "./events";
import Rooms from "./rooms";

const table1 = props => {
  return <button onClick={props.table1}>History</button>
}

class Admin extends Component {
  logout(){
    window.location.replace('/')
  }

  constructor(){
    super()
    this.state={
      showMe:true
    }
  }

  operation(){
    this.setState({
      showMe:false
    })
    
  }
  render() {
    return (
      <div>
        <h1>Admin Room</h1>
        <h5><button onClick={this.logout}>Logout</button></h5>
        <History/>
        {
          this.state.showMe?
          <History/>
          :null
        }
       
        <button onClick={()=>this.operation()}>Click Me</button>

      </div>
    );
  }
}

export default Admin;
